from qiskit.visualization import plot_histogram
import qsimov_cloud_client as qcc
import warnings


def get_best_solution(counts, maxcut_obj, G):
    sorted_states = sorted(counts.items(), key=(lambda i: i[1]))
    max_val = sorted(counts.items(), key=(lambda i: i[1]))[-1][1]
    solutions = [(state, maxcut_obj(state, G)) for state, val in sorted_states if val == max_val]
    return sorted(solutions, key=(lambda i: i[1]))[0][0]

def solve_by_brute_force(n_qubits, maxcut_obj, G):
    max_val = 0
    state_sol = ""
    for i in range(2**n_qubits):
        state_bin = format(i, '0' + str(n_qubits) + 'b')[::-1]
        val = maxcut_obj(state_bin, G)

        if max_val > val:
            max_val = val
            state_sol = state_bin[::-1]
    return state_sol, max_val


def histogram_with_marked_solution(counts, solution):
    fig = plot_histogram(counts, figsize=(20, 5))

    colors_1 = ['#04e5bb' if state == solution else '#020e34' for state, count in sorted(counts.items(), key=(lambda i: i[0]))]

    for p, c in zip(fig.axes[0].patches, colors_1):
        p.set_facecolor(c)
        
    return fig
        
